Create table login
(
 username nvarchar(20),
 password nvarchar(32)
 )
 Create procedure sp_Login
 @username nvarchar(20),
 @password nvarchar(32)
 as
 begin
 select*from login where username = @username and password = @password
 end

 create table Users
 (
 UserId int IDENTITY (1,1) Primary Key Not null,
 UserName varchar(50) Not null,
 Email varchar(100) Not null,
 Password varchar(32) Not null,
 CreateDate datetime Not null
 )
 create table Buyer
 (
 BuyerId int IDENTITY (3000,1) Primary Key Not null,
 PhoneNumber varchar(11) Not Null,
 CreditCard nvarchar(34) Not Null,
 Password varchar(32) Not null,
 CreateDate datetime null,
 UserId int Foreign key references Users(UserId) Not null
 )
 create table Playlist
 (
 PlaylistId int IDENTITY (5000,1)  Primary Key Not null,
 PlaylistName varchar(50) Not null,
 CreateDate datetime null,
 BuyerId int Foreign key references Buyer(BuyerId) Not null,
 SongId int Foreign key references Song(SongId) Not null
 )
 create table Song
 (
 SongId int IDENTITY (7000,1)  Primary Key Not null,
 SongName varchar(50) Not null,
 Genre varchar(25) Not null,
 ArtistId int Foreign key references Artist(ArtistId)
 )
 create table Album
 (
 AlbumId int IDENTITY (9000,1)  Primary Key Not null,
 AlbumName varchar(50) Not null,
 Genre varchar(25) Not null,
 ArtistId int Foreign key references Artist(ArtistId) Not null
 )
 create table Artist
 (
 ArtistId int IDENTITY (11000,1)  Primary Key Not null,
 ArtistName varchar(50) Not null,
 About varchar(200) Not null,
 )
